import { BrowserRouter, Route } from "react-router-dom";
import Layout from "./Pages/Layout";


function App() {
  return (
   <>
   <BrowserRouter>
   <Routes>
    <Route path="/" element={<Layout />} />
   </Routes>
   </BrowserRouter>
   </>
  );
}

export default App;
